import React from 'react'

function Card({ jargon, definition, sentence, image, id }) {
    return (
        <div id={id}>
            <h3 id={jargon}>{jargon}</h3>
            <p id={definition}>{definition}</p>
            <p id={sentence}>{sentence}</p>
            <iframe id={image} src={image} height='240' width='240' frameBorder='0'></iframe>
        </div>
    )
}

export default Card
